package aoc

import org.assertj.core.api.Assertions.assertThat
import org.junit.Test
import kotlin.math.absoluteValue

class Advent5 {
    @Test
    fun hopla() {
        val folded = testPolymer.toCharArray().foldPolymer()

        assertThat(folded.length).isEqualTo(10)
    }

    @Test
    fun hopla2() {
        val folded = polymer.toCharArray().foldPolymer()

        assertThat(folded.length).isEqualTo(10368)
    }

    @Test
    fun hopla3() {

        val minLength = ('a'..'z')
            .map { remove ->
                val removeUpper = remove.toUpperCase()
                polymer.toCharArray()
                    .filterNot { it == remove }
                    .filterNot { it == removeUpper }
                    .toCharArray()
            }
            .map { it.foldPolymer() }
            .map { it.length }
            .min() ?: 0

        assertThat(minLength).isEqualTo(4122)
    }

    fun CharArray.foldPolymer(): StringBuilder {
        return this.fold(StringBuilder()) { builder, next ->
            if (builder.isNotEmpty() && (builder.last() - next).absoluteValue == 32) {
                // drop prev symbol
                builder.setLength(builder.length - 1)
            } else {
                builder.append(next)
            }
            builder
        }
    }

    val testPolymer = "dabAcCaCBAcCcaDA"
    val polymer =
        ""
}
